INSERT INTO `tokens` VALUES ('0b51c0dfa57cc6b7df234b846ec414027c2c7c30e2e5ba920e5a7c6a9cf05ac6',1,'0314b3c24222a0f24ddc5b538abe65933ea0db5e6da2e09d2dea0b5b385e865135',0,100,'Betäubungsmittel','Im deutschen Betäubungsmittelgesetz (BtMG) werden alle Stoffe oder Zubereitungen, die in Anlage I bis III zu § 1 Abs. 1 BtMG aufgelistet sind, als Betäubungsmittel bezeichnet. Anbau, Herstellung, Handel, Einfuhr, Ausfuhr, Abgabe, Veräußerung, Inverkehrbringung und Erwerb, wofür eine Erlaubnis nach § 3 BtMG notwendig ist, sind in diesem Gesetz geregelt. ','',1,0,0,'',0,NULL,'{\n  \"keyvalues\" : [ {\n    \"key\" : \"{\\n  \\\"version\\\" : 1,\\n  \\\"media\\\" : {\\n    \\\"version\\\" : 1,\\n    \\\"uiselection\\\" : false,\\n    \\\"downloadURL\\\" : \\\"/media?id=null\\\"\\n  },\\n  \\\"uiselection\\\" : false,\\n  \\\"productoption\\\" : [ ],\\n  \\\"productimages\\\" : [ {\\n    \\\"version\\\" : 1,\\n    \\\"productid\\\" : 201904020100000007,\\n    \\\"imageid\\\" : 201904020100000006,\\n    \\\"name\\\" : \\\"be\\\"\\n  } ],\\n  \\\"itemId\\\" : 201904020100000007,\\n  \\\"userid\\\" : 201707040100000004,\\n  \\\"categoryId\\\" : \\\"\\\",\\n  \\\"sku\\\" : \\\"betäubungsmittel\\\",\\n  \\\"name\\\" : \\\"Betäubungsmittel\\\",\\n  \\\"description\\\" : \\\"Im deutschen Betäubungsmittelgesetz (BtMG) werden alle Stoffe oder Zubereitungen, die in Anlage I bis III zu § 1 Abs. 1 BtMG aufgelistet sind, als Betäubungsmittel bezeichnet. Anbau, Herstellung, Handel, Einfuhr, Ausfuhr, Abgabe, Veräußerung, Inverkehrbringung und Erwerb, wofür eine Erlaubnis nach § 3 BtMG notwendig ist, sind in diesem Gesetz geregelt. \\\",\\n  \\\"detail\\\" : \\\"<br><div><img src=\\\\\\\"/media?id=201904020100000006\\\\\\\"></div><div><p>Im <a href=\\\\\\\"https://de.wikipedia.org/wiki/Bet%C3%A4ubungsmittelgesetz_(Deutschland)\\\\\\\" title=\\\\\\\"Betäubungsmittelgesetz (Deutschland)\\\\\\\">deutschen Betäubungsmittelgesetz</a> (BtMG) werden alle Stoffe oder Zubereitungen, die in Anlage I bis III zu <span class=\\\\\\\"plainlinks-print\\\\\\\"><a rel=\\\\\\\"nofollow\\\\\\\" class=\\\\\\\"external text\\\\\\\" href=\\\\\\\"https://www.gesetze-im-internet.de/btmg_1981/__1.html\\\\\\\">§ 1</a></span>\\\\r\\\\n Abs. 1 BtMG aufgelistet sind, als Betäubungsmittel bezeichnet. Anbau, \\\\r\\\\nHerstellung, Handel, Einfuhr, Ausfuhr, Abgabe, Veräußerung, \\\\r\\\\nInverkehrbringung und Erwerb, wofür eine Erlaubnis nach <span class=\\\\\\\"plainlinks-print\\\\\\\"><a rel=\\\\\\\"nofollow\\\\\\\" class=\\\\\\\"external text\\\\\\\" href=\\\\\\\"https://www.gesetze-im-internet.de/btmg_1981/__3.html\\\\\\\">§ 3</a></span> BtMG notwendig ist, sind in diesem Gesetz geregelt.\\\\r\\\\n</p><p>Die Medizin verwendet bevorzugt den Begriff <a href=\\\\\\\"https://de.wikipedia.org/wiki/An%C3%A4sthetikum\\\\\\\" title=\\\\\\\"Anästhetikum\\\\\\\">Anästhetikum</a>.\\\\r\\\\n Damit bezeichnet man Medikamente, die zur Erzeugung einer Anästhesie \\\\r\\\\n(Zustand einer Empfindungslosigkeit – ob örtlich oder allgemein) dienen.\\\\r\\\\nTeilweise überschneiden sich der juristische Begriff und der \\\\r\\\\nmedizinische Begriff:\\\\r\\\\n(Beispiel: <a href=\\\\\\\"https://de.wikipedia.org/wiki/Kokain\\\\\\\" title=\\\\\\\"Kokain\\\\\\\">Kokain</a>, unter anderem ein <a href=\\\\\\\"https://de.wikipedia.org/wiki/Lokalan%C3%A4sthetikum\\\\\\\" title=\\\\\\\"Lokalanästhetikum\\\\\\\">Lokalanästhetikum</a>, untersteht <a href=\\\\\\\"https://de.wikipedia.org/wiki/Bet%C3%A4ubungsmittelgesetz_(Deutschland)\\\\\\\" title=\\\\\\\"Betäubungsmittelgesetz (Deutschland)\\\\\\\">betäubungsmittelrechtlichen Vorschriften)</a>, <a href=\\\\\\\"https://de.wikipedia.org/wiki/Lidocain\\\\\\\" title=\\\\\\\"Lidocain\\\\\\\">Lidocain</a>\\\\r\\\\n beispielsweise wirkt ebenso lokalanästhesierend, untersteht jedoch \\\\r\\\\nkeinen betäubungsmittelrechtlichen Vorschriften, da es – im Gegensatz \\\\r\\\\nzur Substanz Kokain – kein signifikantes Missbrauchspotenzial – \\\\r\\\\nbeispielsweise als <a href=\\\\\\\"https://de.wikipedia.org/wiki/Droge\\\\\\\" title=\\\\\\\"Droge\\\\\\\">Rauschdroge</a> – besitzt. \\\\r\\\\nEbenso unterstehen <a href=\\\\\\\"https://de.wikipedia.org/wiki/Opioide\\\\\\\" title=\\\\\\\"Opioide\\\\\\\">Opioide</a>\\\\r\\\\n zum Großteil dem Betäubungsmittelgesetz, da diese – neben einem hohen \\\\r\\\\nMissbrauchspotenzial als Droge, bedingt durch dessen (je nach Substanz \\\\r\\\\nund Applikationsart mehr oder weniger) starke <a href=\\\\\\\"https://de.wikipedia.org/wiki/Psychotrop\\\\\\\" class=\\\\\\\"mw-redirect\\\\\\\" title=\\\\\\\"Psychotrop\\\\\\\">psychotrope Wirkung</a> – auch ein keineswegs zu unterschätzendes, hohes Abhängigkeitspotenzial besitzen. \\\\r\\\\n<a href=\\\\\\\"https://de.wikipedia.org/wiki/Nichtopioid-Analgetikum\\\\\\\" title=\\\\\\\"Nichtopioid-Analgetikum\\\\\\\">Nichtopioid-Analgetika</a> unterstehen im Regelfall keinen betäubungsmittelrechtlichen Vorschriften (<a href=\\\\\\\"https://de.wikipedia.org/wiki/Ibuprofen\\\\\\\" title=\\\\\\\"Ibuprofen\\\\\\\">Ibuprofen</a>, <a href=\\\\\\\"https://de.wikipedia.org/wiki/Acetylsalicyls%C3%A4ure\\\\\\\" title=\\\\\\\"Acetylsalicylsäure\\\\\\\">Acetylsalicylsäure</a>, <a href=\\\\\\\"https://de.wikipedia.org/wiki/Paracetamol\\\\\\\" title=\\\\\\\"Paracetamol\\\\\\\">Paracetamol</a>), da sie nicht oder nur geringfügig <a href=\\\\\\\"https://de.wikipedia.org/wiki/Psychotrop\\\\\\\" class=\\\\\\\"mw-redirect\\\\\\\" title=\\\\\\\"Psychotrop\\\\\\\">psychotrop</a> wirken und daher kein nennenswerter Missbrauch zu Rauschzwecken möglich ist (mit einigen Ausnahmen wie <a href=\\\\\\\"https://de.wikipedia.org/wiki/Ketamin\\\\\\\" title=\\\\\\\"Ketamin\\\\\\\">Ketamin</a>).\\\\r\\\\nEin weiteres Beispiel für BtM sind <a href=\\\\\\\"https://de.wikipedia.org/wiki/Methadon\\\\\\\" title=\\\\\\\"Methadon\\\\\\\">Methadon</a>-Zubereitungen, die in der <a href=\\\\\\\"https://de.wikipedia.org/wiki/Drogenersatztherapie\\\\\\\" class=\\\\\\\"mw-redirect\\\\\\\" title=\\\\\\\"Drogenersatztherapie\\\\\\\">Drogenersatztherapie</a> zum Einsatz kommen und in Apotheken als Rezepturarzneimittel hergestellt werden. Auch Substanzen wie etwa <a href=\\\\\\\"https://de.wikipedia.org/wiki/Amphetamin\\\\\\\" title=\\\\\\\"Amphetamin\\\\\\\">Amphetamin</a>, die nicht betäubend, sondern im Gegenteil stark anregend wirken, sind BtM im Sinne des Gesetzes.\\\\r\\\\n</p></div>\\\",\\n  \\\"productclass\\\" : \\\"medicament\\\",\\n  \\\"properties\\\" : \\\"sell\\\",\\n  \\\"price\\\" : 75.0,\\n  \\\"shippingmethod\\\" : \\\"shippinghome\\\",\\n  \\\"stockQuantity\\\" : 100,\\n  \\\"currency\\\" : \\\"EUR\\\",\\n  \\\"ean13\\\" : \\\"\\\",\\n  \\\"shopid\\\" : 201903240100000004,\\n  \\\"languageCode\\\" : \\\"de\\\",\\n  \\\"priceinterval\\\" : \\\"ONCE\\\",\\n  \\\"status\\\" : \\\"WAITING\\\",\\n  \\\"downloadURL\\\" : \\\"/media?id=null\\\",\\n  \\\"tokenid\\\" : \\\"032209fe004faf9d31e90c36f2b29d611147e563ed36bc0cd9f29db7abbaf3f0c3\\\",\\n  \\\"pubkey\\\" : \\\"033e3be06fd10014a7e1aaf5056bf0ff7f133441c3a5a272c5c7b420448c8808bf\\\",\\n  \\\"description140\\\" : \\\"Im deutschen Betäubungsmittelgesetz (BtMG) werden alle Stoffe oder Zubereitungen, die in Anlage I bis III zu § 1 Abs. 1 BtMG aufgelistet si\\\",\\n  \\\"productDetail\\\" : \\\"/public/product.jsf?id=201904020100000007\\\",\\n  \\\"candeploy\\\" : false,\\n  \\\"canAddCard\\\" : true,\\n  \\\"token\\\" : true,\\n  \\\"canDownload\\\" : false,\\n  \\\"smallImage\\\" : \\\"/media?id=201904020100000006\\\",\\n  \\\"detail140\\\" : \\\"<br><div><img src=\\\\\\\"/media?id=201904020100000006\\\\\\\"></div><div><p>Im <a href=\\\\\\\"https://de.wikipedia.org/wiki/Bet%C3%A4ubungsmittelgesetz_(Deuts\\\"\\n}\"\n  } ]\n}',NULL,NULL,NULL),('0d5d3d47e97243042f3d4052958274d36de57b66d11220d1ffef0d67ac92655d',1,'022bbcf7ba14504b1b9eeeb9692b732b902a73d55ad85620d5bc21921a2e607573',0,678900000,'EUR','EUR',NULL,1,0,0,'',0,NULL,NULL,NULL,NULL,NULL),('118de8aae10f6784892044a327b86d958381262b826ac6a773d666a959be9e54',1,'02ebc45